window.bookSummaryJSON = "<p><b>With Nevermore in full swing, the competition for the Leaderboards is only heating up...</b><br> <br> Many years and even more levels have passed since Jake and friends entered Nevermore. With quite a number of floors passed, they turn their attention to the Challenge Dungeons.<br> <br> These Challenge Dungeons offer – as the name suggests – unique challenges and circumstances, and completing them will earn each Nevermore competitor points and multipliers to their existing points. As things unfold, it quickly becomes clear it’s through these dungeons that the true top-scorer of the Nevermore Leaderboards will be found.<br> <br> Jake has no plans on losing out to anyone, especially not his fellow Chosen, Ell’Hakan.<br> <br> Follow Jake as he takes on these five dungeons, facing unique challenges, environments, scenarios, and opponents, with perhaps even a few truly worthwhile duels sprinkled in there.<br> <br> Oh, and labyrinths. Can’t forget the labyrinths, lest we make Minaga sad.<br> <br> <b>Book 11 of the hit Primal Hunter LitRPG Series is here. Grab your copy today!<br> <br> About the Series:</b> Experience an Apocalypse LitRPG with levels, classes, professions, skills, dungeons, loot, and all of the great traits of Progression Fantasy and LitRPG that you've come to expect. Follow Jake as he explores this new vast multiverse filled with challenges and opportunities. As he grows in power and slowly transforms from a bored office worker to a true apex hunter.</p>"; 
